import axios from "axios";
import './navigation.css';
import Header from './components/header'
import BelowHeader from './components/BelowHeader'
import Tabs from './components/tabs'







function App() {
    return (
        <div>
            <Header></Header>
            <BelowHeader></BelowHeader>    
            <Tabs></Tabs>     

        </div>
    )
}

export default App
